import React from 'react';
import {MDBBtn, MDBInput, MDBRadio} from "mdb-react-ui-kit";

const Filter = () => {
    return (
        <>
            <div className="row">
                <div className="col-6">
                    <h3>Search</h3>
                    <div className="d-flex justify-content-center align-items-center mb-4">
                        <MDBInput
                            type="text"
                            id="form1"
                            label="Search task..."
                            wrapperClass="flex-fill"
                        />
                    </div>
                </div>
                <div className="col-6">
                    <h3>Filter</h3>
                    <MDBRadio name='filter' id='inlineRadio1' value='ALL' label='All' inline />
                    <MDBRadio name='filter' id='inlineRadio2' value='COMPLETE' label='Complete' inline />
                    <MDBRadio name='filter' id='inlineRadio3' value='ACTIVE' label='Active' inline />
                </div>
                <hr></hr>
            </div>
        </>
    );
};

export default Filter;
